import React from "react";
import "../styles/Engineering.css";

const Engineering = () => {
  return (
    <div className="page">
      <h2>Engineering Subjects</h2>
      <p>Mechanical, Civil, CSE, ECE, and more.</p>
    </div>
  );
};

export default Engineering;
